-- ----------------------------
-- Procedure structure for GET_COMMON_WORD
-- ----------------------------
CREATE OR REPLACE PROCEDURE "ZHANGCHAO"."GET_COMMON_WORD"
(common_word OUT SYS_REFCURSOR,o_result OUT INTEGER)
IS
BEGIN
		OPEN common_word FOR
		SELECT FWORD,FMEAN,DIFF FROM T_CET4 
		WHERE COMMON=1 AND rownum<=10 ORDER BY FID;
    o_result :=1;
EXCEPTION
    WHEN OTHERS THEN
        o_result :=0;
END get_common_word;
/

